Execution We can expand on this functionality with a simple macro that provides access to a contract's endpoints as callable functions. This functionality is only available if you have access to the message structs's crate. You will want to feature-flag the function generation to prevent cw-orchestrator entering as a dependency when building your contract. Here's an example with the macro shielded behind a "interface" feature flag: #[cw_serde]
#[cfg_attr(feature = "interface", derive(cw_orch::ExecuteFns))]
pub enum ExecuteMsg{ Freeze {}, UpdateAdmins { admins: Vec<String> }, // Indicates that the call expects funds `Vec<Coin>` #[cfg_attr(feature = "interface", payable)] Deposit {}
} // If we now define a orchestrateable contract with this execute message
#[interface(InstantiateMsg, ExecuteMsg, QueryMsg, MigrateMsg)]
pub struct MyContract<Chain>; // Then the message variants are available as functions on the struct through an "ExecuteFns" trait.
impl<Chain: CwEnv + Clone> MyContract<Chain> { pub fn test_macro(&self) -> Result<(),CwOrchError> { self.freeze()?; self.update_admins(vec![])?; self.deposit(&[Coin::new(13,"juno")])?; Ok(()) }
} In order for the above code to work, you will need to follow those simple steps : Add the following line to your packages/my-project.Cargo.toml. This will allow to activate the interface feature for creating ExecuteFns outside of the crate [features]
interface=[] Add the following import in your packages/interfaces/src/my-contract.rs file : use my_project::my_contract::ExecuteMsgFns; Query Generating query functions is a similar process but has the added advantage of using the cosmwasm-schema return tags to detect the query's return type. #[cosmwasm_schema::cw_serde]
#[derive(QueryResponses)]
#[cfg_attr(feature = "interface", derive(cw_orch::QueryFns))]
pub enum QueryMsg { /// Returns [`InfoResponse`] #[returns(InfoResponse)] Info {},
} #[cosmwasm_schema::cw_serde]
pub struct InfoResponse { pub admin: Addr,
} // If we now define a orchestrateable contract with this execute message
#[interface(InstantiateMsg, ExecuteMsg, QueryMsg, MigrateMsg)]
pub struct MyContract<Chain>; // Then the message variants are available as functions on the struct through an "ExecuteFns" trait.
impl<Chain: CwEnv + Clone> MyContract<Chain> { pub fn test_macro(&self) -> Result<(),CwOrchError> { // No need to specify returned type! // info of type `InfoResponse` is returned let info = self.info()?; let admin: Addr = info.admin; Ok(()) }
} In order to derive query functions, you NEED to serive the QueryResponses crate for your QueryMsgs struct. This is mandatory in order to ensure type-safety for all messages and responses. This time, add the following import in your packages/interfaces/src/my-contract.rs file : rust use my_project::my_contract::QueryMsgFns; Refinement You can also refine your contract interface manually to add more complex interactions. // interfaces/src/my_contract.rs
// Import the cw-orchestrator traits
use cw_orch::interface::*;
// ... impl<Chain: CwEnv> MyContract<Chain> { pub fn new(contract_id: &str, chain: Chain) -> Self { // ... } /// Query the balance of an address /// `address` - the address to query pub fn balance(&self, address: Addr) -> Result<BalanceResponse> { let balance_query = QueryMsg::Balance { address }; self.query(balance_query) } /// Update the balance of an address /// `address` - the address to update /// `balance` - the new balance pub fn update_balance(&self, address: Addr, balance: Uint128) -> Result<Chain::TxResult> { let update_balance_msg = ExecuteMsg::UpdateBalance { address, balance, }; self.execute(update_balance_msg) }
}

