Now we can implement the cw_orch::Deploy trait for the Abstract struct. impl<Chain: CwEnv> cw_orch::Deploy<Chain> for Abstract<Chain> { // We don't have a custom error type type Error = CwOrchError; type DeployData = semver::Version; fn store_on(chain: Chain) -> Result<Self, Self::Error> { // "abstract" is a reserved keyword in rust! let mut abstrct = Self::new(chain); // Only include mock when `integration` flag is set if cfg!(feature = "integration") { abstrct.ans_host .as_instance_mut() .set_mock(Box::new(ContractWrapper::new_with_empty( ::ans_host::contract::execute, ::ans_host::contract::instantiate, ::ans_host::contract::query, ))); abstrct.version_control.as_instance_mut().set_mock(Box::new( cw_multi_test::ContractWrapper::new_with_empty( ::version_control::contract::execute, ::version_control::contract::instantiate, ::version_control::contract::query, ), )); } // Upload the contracts to the chain abstrct.ans_host.upload()?; abstrct.version_control.upload()?; Ok(abstrct) } fn deploy_on(chain: Chain, version: semver::Version) -> Result<Self, CwOrchError> { // ########### Upload ############## let abstrct = Self::store_on(chain)?; // ########### Instantiate ############## abstrct.ans_host.instantiate( &abstract_os::ans_host::InstantiateMsg {}, Some(sender), None, )?; abstrct.version_control.instantiate( &abstract_os::version_control::InstantiateMsg {}, Some(sender), None, )?; // ... Ok(abstrct) } fn load_from(chain: Chain) -> Result<Self, Self::Error> { let abstrct = Self::new(chain); Ok(abstrct) }
} Now Abstract is an application that can be deployed to a mock and real environment with one line of code. fn setup_test(mock: Mock) -> Result<(), CwOrchError> { let version = "1.0.0".parse().unwrap(); // Deploy abstract let abstract_ = Abstract::deploy_on(mock.clone(), version)?;
} And then when setting up your own deployment you can load these applications to access their contracts (for accessing configuration, addresses, ...) impl<Chain: CwEnv> cw_orch::Deploy<Chain> for MyApplication<Chain> { /// ... fn deploy_on(chain: Chain, _data: Empty) -> Result<Self, CwOrchError> { let abstract_: Abstract = Abstract::load_from(chain)?; /// ... do stuff with Abstract }
}

