cw-orchestrator provides an additional macro to simplify contract calls and queries. The macro generates functions on the interface for each variant of the contract's ExecuteMsg and QueryMsg. Enabling this functionality is very straight-forward. Find your ExecuteMsg and QueryMsg definitions and add the ExecuteFns and QueryFns derive macros to them like below: #[cfg_attr(feature = "interface", derive(ExecuteFns))]
pub enum ExecuteMsg { Increment {}, ...
} #[cfg_attr(feature = "interface", derive(QueryFns))]
pub enum QueryMsg { #[returns(ConfigResponse)] Config {} ...
} Any variant of the ExecuteMsg and QueryMsg that has a #[derive(ExecuteFns)] or #[derive(QueryFns)] will have a function generated on the interface through a trait. The function will have the same name as the variant and will take the same arguments as the variant. You can access these functions by importing the generated traits form the message file. The generated traits are named ExecuteMsgFns and QueryMsgFns. // Import the generated traits
use example_contract::msg::{ExecuteMsgFns, QueryMsgFns}; #[test]
fn example_test() { // init mock environment let sender = Addr::unchecked("sender"); // Init the mock environment (cw-multi-test App) let mock = Mock::new(&sender); // `new()` function is available to construct the contract interface let example_contract = ExampleContract::new("example_contract", mock); // ... upload and instantiate like before // Execute the increment endpoint example_contract.increment()?; // Query the config // Return type optional! let resp: QueryResponse = example_contract.config()?;
} The function arguments are ordered alphabetically to prevent breaking changes when struct fields are moved.

